        function emojiParser() {
            if (arguments[0] === "Github") {
                renderGithub()
            }else if(arguments[0] === 'Regular') {
                renderRegular()
            }else if(arguments[0] === undefined) {
                renderUndefined()
            }else{
                console.log('Invalid option passed')
            }
        }
 

        function renderUndefined() {
            for (key in undefined_emojis) {
                document.body.innerHTML += undefined_emojis[key]
            }
        }

        function urlExtractor(input) {
            var urlRegex = /(https?:\/\/[^ ]*)/;
            var url = input.match(urlRegex)[1];
            const imageSrc = url.split(">")[0].slice(0, -1)            
            const img = document.createElement('img')
            img.src = `${imageSrc}`
            document.body.appendChild(img)
        }

        function renderGithub() {
            for (const [key, value] of Object.entries(github)) {
               
                urlExtractor(value)
            }
        }

        function renderRegular() {
            for (const [key, value] of Object.entries(regular)) {
                console.log(key)
            }
        }


        emojiParser('Regular')